GXRModeObj* gc_vmode;
uint32_t* gc_fb;


static void initialize_platform(void)
{
	VIDEO_Init();
	PAD_Init();
	
	gc_vmode = VIDEO_GetPreferredMode(NULL);
	VIDEO_Configure(gc_vmode);

	gc_fb = MEM_K0_TO_K1(SYS_AllocateFramebuffer(gc_vmode));
	
	console_init(gc_fb, 20, 20, gc_vmode->fbWidth, gc_vmode->xfbHeight, gc_vmode->fbWidth * 2);
	VIDEO_ClearFrameBuffer(gc_vmode, gc_fb, COLOR_BLACK);
	VIDEO_SetNextFramebuffer(gc_fb);
	VIDEO_SetBlack(FALSE);
	VIDEO_Flush();
	VIDEO_WaitVSync();

	if (gc_vmode->viTVMode&VI_NON_INTERLACE)
		VIDEO_WaitVSync();
}

static void quit(void)
{
	for (;;)
		VIDEO_WaitVSync();
}


void main(void)
{
	initialize_platform();

	if (!loadrom(instrtest)) {
		logerror("Couldn't load rom!\n");
		quit();
	}

	resetcpu();
	resetppu();
	resetapu();

	for (;;) {
		const unsigned clk = stepcpu();
		stepppu(clk * 3);
		stepapu(clk);
	}
}
